import React from "react";
import { Helmet } from "react-helmet";

function Landingpage() {
  return (
    <>
      <Helmet>
        <meta charSet="utf-8" />
        <meta name="viewport" content="width=device-width, initial-scale=1" />
        <title>Railroad Cotton Exchange</title>
        <link
          rel="stylesheet"
          href="https://use.fontawesome.com/releases/v5.15.4/css/all.css"
          integrity="sha384-jLKHWMZzH+zDO3MYoLVRVO5pcbc5JJ9y8xstQcP3CVV4Y6jx+f+5TSv8kF8y4FH4"
          crossOrigin="anonymous"
        />
        <style>
          {`
            /* Move your entire CSS string here safely */
            body {
              background-color: white;
              color: #1a202c;
              font-family: 'Inter', sans-serif;
              margin: 0;
            }

            /* Example - include all other styles like header, .container, etc. */
            header {
              border-bottom: 1px solid #d1d5db;
            }

            /* ...your entire CSS content */
          `}
        </style>
      </Helmet>

      {/* Now your actual HTML structure */}
      <header>
        <div className="container header-inner">
          <div className="logo-section">
            <img src="/logo.png" alt="Railroad Cotton Exchange Logo" />
            Railroad Cotton Exchange
          </div>
          <nav className="desktop-nav">
            <span className="active">Home</span>
            <span>Shop</span>
            <span>About</span>
          </nav>
          <div className="account-desktop">
            <button><i className="fas fa-user-circle"></i> Account</button>
          </div>
        </div>
      </header>

      {/* Add your form, hero banner, sections, etc. here */}
    </>
  );
}

export default Landingpage;
